import Input from '../components/input';
import Button from '../components/button';
import Form from '../components/form';

class RSVP extends React.Component {
  render() {
    return (
      <Form className='rsvp'>
        <Input />
        <Input />
        <Input />
        <Button />
      </Form>
    )
  }

}

export default RSVP
